import React from 'react';
import SymmetryWave from '../components/symmetry-wave.jsx';
import Footer from '../components/footer.jsx';
import '../asset/css/cooperation.css';
export default class Cooperation extends React.Component {

    constructor(props) {
        super(props)
        this.timer = null;
    }

    componentDidMount() {
        window.addEventListener('scroll', this.pockerAnimate);
    }

    componentDidUpdate() {
        if(this.props.location.pathname !== "/cooperation"){
            window.removeEventListener('scroll', this.pockerAnimate);
        }
    }

    componentWillUnMount(){
        window.removeEventListener('scroll', this.pockerAnimate);        
    }

    pockerAnimate = () => {
        
        if(this.timer){
            const t = new Date().getTime();
            const disT = (t-this.timer) * 0.001;
            if(disT<0.8){
                return
            }else{
                const newT = new Date().getTime();
                this.timer = newT;
            }
           
        }else{
            let t = new Date().getTime();
            this.timer = t
        }

        const ele = document.getElementById('brand-container') || this.container;
        const scroll_pos = window.pageYOffset || document.documentElement.scrollTop + window.innerHeight || document.documentElement.clientHeight || document.body.clientHeight;
        const element_pos = ele.offsetTop - ele.offsetHeight * 0.5;

        console.log(scroll_pos, element_pos)
        if (scroll_pos > element_pos) {
            if(scroll_pos > ele.offsetTop + ele.offsetHeight){
                this.init()
                return 
            }
            this.brandAnimation();
        };
    }

    init() {
        const container = document.getElementById('brand-container') || this.container;
        const items = container.children;
        Array.from(items).forEach(v => {
            v.style.transitionDelay = '0s';
            v.classList.remove('hover');
        });
    }

    brandAnimation = () => {
        function ani() {
            const container = document.querySelector('.brand-container');
            const items = container.children;
            Array.from(items).forEach((v, i) => {
                v.style.transitionDelay = `${i * 0.1}s`;
                v.classList.add('hover');
            });
        }
        ani()
    }

    render() {

        const Wave = () => {
            const W = window && window.innerWidth;
            const H = window && window.innerHeight;
            const svgH = H * 0.15
            return (
                <svg
                    id='cooperation-svg'
                    width={W}
                    height={svgH}
                >
                    <path
                        fill='white'
                        stroke='white'
                        strokeWidth='2px'
                        d={`
                            M0 0
                            C${W * 0.25} ${svgH * 0.5} ${W * 0.75} ${svgH * 0.85} ${W} 30
                            L${W} ${svgH}
                            L0 ${svgH}
                            Z
                        `}
                    />
                </svg>
            )
        }

        const BrandWall = () => {
            const items = [];
            for(var i=1; i<20; i++){
                items.push(
                    <div key={i} className='item'>
                        <div className='front'></div>
                        <div className='back'><img src={require(`../asset/image/logo/${i}.png`)} alt='brand_logo'/></div>
                    </div>
                )
            }
            return items
        }

        return (
            <div className='cooperation animated fadeInUp'>
                        <div className='content-1'>
                            <h1>链接品牌与学生</h1>
                            <div>
                                <h3>我们致力于将品牌与亿万未来消费者相连接</h3>
                                <h3>同众多优质品牌联盟共同打造全新的青年品牌消费社 群文化并共享市场推广成果</h3>
                            </div>
                            <SymmetryWave />
                        </div>

                        <div className='content-2'>
                            <h1>部分合作品牌展示</h1>
                            <div id='brand-container' ref={x => this.container = x} className='brand-container'>
                                {BrandWall()}
                            </div>
                        </div>
                        <div className='content-3'>
                            <h1>与 YoungPass 合作</h1>
                            <div>
                                <h3>加入YoungPass品牌联盟，与品牌未来关键消费者建立高效的交流和互动，</h3>
                                <h3>传播极具号召力的品牌文化，真正触达并更好的服务年轻消费者，实现最具价值和效益的广告传播</h3>
                            </div>
                            <div className='info-container'>
                                <div className='item'>
                                    <svg viewBox='0 0 192 138.24'>
                                        <g>
                                            <image width='800' height='576' transform='scale(0.24)' xlinkHref='data:image/png;base64,' />
                                        </g>
                                    </svg>
                                    <h2>学生认证</h2>
                                    <p>YoungPass通过国家稳定且官方的学生学籍验证方式验证用户身份，保障所有用户的身份真实有效。</p>
                                </div>
                                <div className='item'>
                                <svg viewBox="0 0 192 183.12">
    <g>
        <image width="800" height="763" transform="scale(0.24)" xlinkHref="data:image/png;base64,"/>
    </g>
</svg>
                                    <h2>高转化率</h2>
                                    <p>我们的高级CRM数据系统及独有推广渠道模型很大成都上保障了用户关注总量的增长以及消费转化的高频， 极大成都上促成YoungPass实现大学生市场用户的高占有率。</p>
                                </div>
                                <div className='item'>
                                    <svg viewBox="0 0 182.16 174.24"><g><image width="759" height="726" transform="scale(0.24)" xlinkHref="data:image/png;base64,"/></g></svg>                  <h2>科学的合作盈利模式</h2>
                                    <p>比起传统的广告及高风险互联网导流合作模式来说，我们的合作模式（CPS）更能快速建立起双方互相信赖和共赢的基础。只有品牌合作网站实现了收益的增长，我们才会同步获得对应比例的收益。</p>
                                </div>
                            </div>
                            <Wave />
                        </div>
                        <div className='cooperation-content-4'>
                            <div className='contact'>
                                <div className='item'>
                                    <svg viewBox='0 0 192 142.32'>
                                        <image width='800' height='593' transform='scale(.24)' xlinkHref='data:image/png;base64,' />
                                    </svg>
                                    <p>发送合作需求至</p>
                                    <p>young_bd@shlanyee.com</p>
                                </div>
                                <div className='item'>
                                    <img src={require('../asset/image/W-code.png')} alt='' />
                                    <p>YoungPass 客服中心</p>
                                    <p>Wechat: young_mie1</p>
                                </div>
                            </div>
                        </div>
                        <Footer />
            </div>
        )
    }
}